The project will  continue to pursue 3 outputs: 
a) NESC capacity to identify, analyse, and make recommendations on critical policy areas affecting National Development strengthened; 
b) Support facilities for NESC strengthened; 
c) A process of interaction with the private sector and monitoring implementation of policy prescriptions established.

